import React from 'react'




class App extends React.Component () {
  render () { 
    const shoppingList = ['leite', 'arroz', 'feijão', 'banana', 'carne'];
const items = shoppingList.map((item) => {
  console.log("item: ", item);
  return (<li>{ item }</li>);
});
    return ( 
      <div>
        <h2>Lista de Compras</h2>
        <ol>
          {items}
        </ol>
      </div>
    );
  }
}



export default App;
